import FacebookLogin from '@greatsumini/react-facebook-login';
import { Box } from '@mui/material';
import { FbProfile, profileActions } from '../../redux/Profile';
import { useDispatch } from 'react-redux';

type Props = {};

const Login = (props: Props) => {
  const dispatch = useDispatch();

  const onFbProfileSuccess = (response: any) => {
    console.log('response', response);

    const fbResponse: FbProfile = {
      id: response.id,
      fullName: response.name,
      email: response.email,
    };

    dispatch(profileActions.login(fbResponse));
  };

  return (
    <FacebookLogin
      appId='1467702463678075'
      onSuccess={(response) => {
        console.log('Login Success!', response);
      }}
      onFail={(error) => {
        console.log('Login Failed!', error);
      }}
      onProfileSuccess={onFbProfileSuccess}
      style={{
        backgroundColor: '#4267b2',
        color: '#fff',
        fontSize: '16px',
        border: 'none',
        borderRadius: '4px',
        cursor: 'pointer',
      }}
    >
      <Box
        sx={{
          display: 'flex',
          paddingTop: 1,
          paddingBottom: 1,
          paddingLeft: 2,
          paddingRight: 2,
        }}
      >
        <Box sx={{ paddingRight: 2 }}>
          <svg
            xmlns='http://www.w3.org/2000/svg'
            data-name='Ebene 1'
            viewBox='0 0 1024 1024'
            height={25}
            width={25}
          >
            <path
              fill='#fff'
              d='M1024,512C1024,229.23016,794.76978,0,512,0S0,229.23016,0,512c0,255.554,187.231,467.37012,432,505.77777V660H302V512H432V399.2C432,270.87982,508.43854,200,625.38922,200,681.40765,200,740,210,740,210V336H675.43713C611.83508,336,592,375.46667,592,415.95728V512H734L711.3,660H592v357.77777C836.769,979.37012,1024,767.554,1024,512Z'
            />
            <path
              fill='#4267b2'
              d='M711.3,660,734,512H592V415.95728C592,375.46667,611.83508,336,675.43713,336H740V210s-58.59235-10-114.61078-10C508.43854,200,432,270.87982,432,399.2V512H302V660H432v357.77777a517.39619,517.39619,0,0,0,160,0V660Z'
            />
          </svg>
        </Box>
        <Box sx={{ paddingTop: '4px' }}>
          <span>Continue with Facebook</span>
        </Box>
      </Box>
    </FacebookLogin>
  );
};

export default Login;
